import styled from 'styled-components'
import { useState } from 'react'


const Button = styled.button`
  border-radius: 3px;
  border: 2px solid palevioletred;
  color: palevioletred;
  margin: 0 1em;
  padding: 0.25em 1em;
`

const Box = styled.div`
    border: solid;
    border-weight: 2px;
    border-radius: 10px;

    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;

    padding: 50px;
`


export const IdentityPanel = () => {

    let [response, setResponse] = useState("");


    const onSubmit = () => {
        fetch(`http://localhost:8080/getIdentity`)
        .then(data => data.json())
        .then(data => setResponse(data))
        .catch(error => console.log(error))
    }

    return(
        <Box>
            Hello, world! Let's get identity.

            <Button onClick={onSubmit}>Get</Button>
            <br/>
            <textarea style={{maxWidth: 300, wordBreak: "break-all"}} value={JSON.stringify(response)}>
            </textarea>
        </Box>
    )
}
